  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains ortho-rectified
  mosaic tiles, created as a product from the NOAA Integrated Ocean and Coastal Mapping
  (IOCM) initiative. The original images were acquired at a higher resolution than
  the final ortho-rectified mosaic. Ortho-rectified mosaic tiles are an ancillary
  product of NOAA's Coastal Mapping Program (CMP), created through a wider Integrated
  Ocean and Coastal Mapping initiative to increase support for multiple uses of the
  data. The ground sample distance (GSD) for each pixel is 0.50 m. Data are in Geotiff
  format with associated .jpg browse graphics and metadata.\",\n\t\"license_title\":
